#   Algoritmos de ordenamiento

def QuickSort(a,iz,de):

    i = iz
    j = de

    pivote = a[int((iz+de)/2)]

    while i <= j:

        while a[i] < pivote:

            i += 1

        while a[j] > pivote:

            j -= 1

        if i <= j:

            auxi = a[i]

            a[i] = a[j]
            a[j] = auxi

            i += 1
            j -= 1

    if j > iz:

        QuickSort(a,iz,j)

    if i < de:

        QuickSort(a,i,de)

    return a

def ShellSort(array):

    salto = int(len(array)/2)

    while salto > 0:

        i = salto
        if i  < len(array):

            for i in range(len(array)):

                j = i - salto

                while j >= 0:

                    k = j + salto

                    if array[j] <= array[k]:

                        j = -1

                    else:

                        auxi = array[j]

                        array[j] = array[k]
                        array[k] = auxi

                        j -= salto

            salto = int(salto/2)

    return array

def MergeSort(Array):




	len_Array = len(Array)

	#Primer divisin del array principal

	pibote = int(len(Array)/2)

	#Arreglo para la parte izquierda del arreglo

	left = []

	#Arreglos que dividen la parte izquierda ya dividida

	left_l = []

	left_r = []

	#Arreglo para la parte derecho del arreglo

	right = []

	#Arreglos que dividen la parte derecho ya dividida

	right_l = []

	right_r = []

	#Contador que guia el acceso al arregl original

	i = 0

	#Llenado del arreglo que representa a parte izquerda

	for j in range(pibote):


		left.insert(j,Array[i])

		del(Array[i])




	#Llenado del arreglo que representa a parte derecha

	for j in range(pibote):

		right.insert(j,Array[i])

		del(Array[i])




	#Separacin de la parte izquierda del arreglo en otras dos partes pasando primero el llamado 'pibote', que nos servira para partir a la mitad esta parte del arreglo
	pibote = int(len(left)/2)
	i = 0

	#iteracin donde se llena la divisin izquierda

	for x in range(pibote):

		left_l.insert(x,left[i])

		i += 1

	#iteracin donde se llena la divisin derecha

	for x in range(pibote,len(left)):

		left_r.insert(x,left[i])

		i += 1

	#Separacin de la parte izquierda del arreglo en otras dos partes pasando primero el llamado 'pibote', que nos servira para partir a la mitad esta parte del arreglo
	pibote = int(len(right)/2)
	i = 0

	#iteracin donde se llena la divisin derecha, de la divisin ya realizada antes.

	for x in range(pibote):

		right_l.insert(x,right[i])

		i += 1

	#iteracin donde se llena la divisin izquierda, de la divisin ya realizada antes.

	for x in range(pibote,len(right)):

		right_r.insert(x,right[i])

		i += 1




	#En esta iteracin se acomoda la parte izquierda de la primera particion del lado izquierdo

	for i in range(0,len(left_l)-1):

		for j in range(0,len(left_l)-1-i):

			if left_l[j] > left_l[j+1]:

				left_l[j],left_l[j+1] = left_l[j+1],left_l[j]


	#En esta iteracin se acomoda la parte derecha de la primera particion del lado izquierdo

	for i in range(0,len(left_r)-1):

		for j in range(0,len(left_r)-1-i):

			if left_r[j] > left_r[j+1]:

				left_r[j],left_r[j+1] = left_r[j+1],left_r[j]

	#En esta iteracin se acomoda la parte izquierda de la primera particion del lado derecho

	for i in range(0,len(right_l)-1):

		for j in range(0,len(right_l)-1-i):

			if right_l[j] > right_l[j+1]:

				right_l[j],right_l[j+1] = right_l[j+1],right_l[j]

	#En esta iteracin se acomoda la parte derecha de la primera particion del lado derecho

	for i in range(0,len(right_r)-1):

		for j in range(0,len(right_r)-1-i):

			if right_r[j] > right_r[j+1]:

				right_r[j],right_r[j+1] = right_r[j+1],right_r[j]



	#indices que sern utilizados en la siguiente iteracin

	l = 0
	r = 0

	#En este ciclo se van a comparar las dos mitades del lado izquierdo, y sern acomodadas en orden en el arreglo que representa la mitad izquierda del arreglo original

	#El ciclo se realiza con el rango(tamao) del arreglo que representa la parte izquierda del arreglo original
	for i in range(len(left)):


		#En esta condicin se pregunta si el rango de las dos mitades a comparar es mayor a 0, para poder comparar los datos en ellos, si no lo es, pasara al 'else', donde introducira los datos sobrante(que tambien sern los mayores), en el arreglo donde los estamos acomodando
		if len(left_l) > 0 and len(left_r) > 0:

			#Aqui se comparan los datos en el indice actual de ambos arreglos, si se cumple la condicin de que el dato de 'l' sea menor que el de 'r', el dato que de 'l' pasara al arreglo en donde estamos acomodando los datos
			if left_l[l] < left_r[r]:

				#Se introduce el dato de 'l' al arreglo en donde se estn acomodando los datos.
				left[i] = left_l[l]

				#El dato que introducimos al nuevo arreglo es eliminado de su arreglo original
				del(left_l[l])

			#Si no se cumple la condcin anterior, se pasara a esta parte, y en vez de pasar el dato de 'l', al nuevo arreglo, har las operaciones con el dato en el arreglo 'r'
			else:



				left[i] = left_r[r]

				del(left_r[r])


		#Una vez que el tamano de alguno de los arreglos llegue a 0, se pasara a esta parte
		else:

			#Se pregunta si el tamao del arreglo 'l' es igual a 0, si lo es, se entra a esta parte, y se mueve el dato de 'r' a el arreglo donde se estn acomodando los datos, y se elimina de su arreglo original
			if len(left_l) == 0:

				left[i] = left_r[r]

				del(left_r[r])

			#Si el tamao de 'l' no es igual a 0, preguntar si el tamao de 'r' si lo es, y si es correcto, se realizan las mismas acciones que se hicieron dentro de la condicin anterior, pero utilizan 'l'
			elif len(left_r) == 0:

				left[i] = left_l[l]

				del(left_l[l])


	#En este ciclo se van a comparar las dos mitades del lado derecho, y sern acomodadas en orden en el arreglo que representa la mitad derecha del arreglo original

	#Se hace lo mismo que en el ciclo anterior, con la diferencia que aqu se realizaran los operaciones con la mitad derecha del arreglo original

	for i in range(len(right)):



		if len(right_l) > 0 and len(right_r) > 0:


			if right_l[l] < right_r[r]:

				right[i] = right_l[l]

				del(right_l[l])


			else:



				right[i] = right_r[r]

				del(right_r[r])


		else:

			if len(right_l) == 0:

				right[i] = right_r[r]

				del(right_r[r])


			elif len(right_r) == 0:

				right[i] = right_l[l]

				del(right_l[l])



	#Ordenacin final

	for i in range(len_Array):



		if len(left) > 0 and len(right) > 0:


			if left[l] < right[r]:


				Array.insert(i,left[l])
				#Array[i] = left[l]

				del(left[l])


			else:


				Array.insert(i,right[r])
				#Array[i] = right[r]

				del(right[r])


		else:

			if len(left) == 0:

				Array.insert(i,right[r])
				#Array[i] = right[r]

				del(right[r])


			elif len(right) == 0:

				Array.insert(i,left[l])
				#Array[i] = left[l]

				del(left[l])






	# print(left," ",right)
	# print()
	# print()


	return Array

def bubblesort(Array):

	comparaciones = 0
	intercambios = 0

	for i in range(0,len(Array)-1):

		for j in range(0,len(Array)-1-i):

			comparaciones += 1

			if Array[j] > Array[j+1]:

				Array[j],Array[j+1] = Array[j+1],Array[j]

				intercambios += 1

	

	return Array

